- I d. 1 Phía những vị trí không thuộc phạm vi được xác định nào đó; trái với trong. Nhìn ra ngoài. Ai đứng ngoài kia? Yếu tố ngoài hệ thống. Dư luận trong và ngoài nước. Nước ngoài*. 2 Tập hợp những vị trí tuy thuộc phạm vi được xác định nào đó, nhưng nằm ở ranh giới và hướng ra phía những vật xung quanh. Mặt ngoài của cái tủ. Bệnh ngoài da. Áo khoác ngoài. Nhìn bề ngoài. 3 (dùng phụ sau d.). Phía trước so với phía sau, hoặc phía những vị trí ở xa trung tâm so với phía những vị trí ở gần trung tâm; trái với trong. Nhà ngoài. Vây vòng trong vòng ngoài. 4 Vùng địa lí ở vào phía bắc so với địa phương được xác định làm mốc, trong phạm vi đất nước Việt Nam; trái với trong. Ra Hà Nội, ăn Tết ở ngoài ấy. Quà của bà con ngoài này gửi biếu trong đó. 5 (dùng trước d.). Khoảng thời gian sau thời điểm xác định làm mốc không bao lâu. Ra ngoài Tết. Ngoài rằm thì gặt. Tuổi ngoài năm mươi. 6 (dùng trước d.). Phạm vi những gì không trong phạm vi được xác định. Lớp học ngoài giờ. Kết quả ngoài sức tưởng tượng. Việc làm ngoài ý muốn. 7 (dùng trước d.). Phạm vi những gì khác, không kể những cái được xác định. Ngoài báo cáo chính, còn có nhiều báo cáo bổ sung. Ngoài tiền lương ra, không có khoản thu nhập nào khác. Không ai, ngoài anh ta.
